import p1_img from './P_1.png';
import p2_img from './P_2.png';
import p3_img from './P_3.png';
import p4_img from './P_4.png';
import p5_img from './P_5.png';
import p6_img from './P_6.png';
import p7_img from './P_7.png';
import p8_img from './P_8.png';
import p9_img from './P_9.png';
import p10_img from './P_10.png';

let new_collections = [
  {
    id: 1,
    name: "Vegetables",
    image: p1_img,
  },
  {
    id: 2,
    name: "Bakery",
    image: p2_img,
  },
  {
    id: 3,
    name: "Spices",
    image: p3_img,
  },
  {
    id: 4,
    name: "Household",
    image: p4_img,
  },
  {
    id: 5,
    name: "Baby Products",
    image: p5_img,
  },
  {
    id: 6,
    name: "Canned Products",
    image: p6_img,
  },
  {
    id: 7,
    name: "Snacks and Confectionary",
    image: p7_img,
  },
  {
    id: 8,
    name: "Beverages",
    image: p8_img,
  },
  {
    id: 9,
    name: "Frozen Food",
    image: p9_img,
  },
  {
    id: 10,
    name: "Fruits",
    image: p10_img,
  },
];

export default new_collections;
